import React from 'react'
import {
    Dialog,
    Grid,
} from '@material-ui/core'

export default function AddBudgetDialog(props) {
    return (
        <div>
            <Dialog
                open={props.open}
                onClose={props.onClose}
            >
                <Grid container direction="column">
                    <Grid item>
                        Enter budget name
                    </Grid>
                    <Grid item>
                        Select working days
                    </Grid>
                </Grid>
            </Dialog>
        </div>
    )
}
